  if (props.match.league.name.toLowerCase() != "worlds") {
    return null;
  }
  return (
    <div className="match-card-container">
      {props.match.name}
      <br />
      <div className="number-of-games">
        {/* Add Padding to this in CSS */} Best of:{" "}
